    "2016-10-15T16:34:12.833154",nt"name": "narrative-report-bombay-hook-national-wildlife-refuge-september-october-november-and-dec-1-cc3e5",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Bombay Hook NWR
    outlines Refuge accomplishments from September through December of 1947. The report
    begins by summarizing the weather conditions and water conditions during this period.
    Wildlife- including migratory birds, upland game birds, big game animals, furbearers,
    predators, and rodents- is also covered. The Refuge development and maintenance
    section discusses physical developments and plantings. Resource management is outlined;
    topics include fur harvesting. A progress report on field investigations and applied
    research is also provided. The public relations section of the report describes
    recreational uses, Refuge visitors, Refuge participation, and hunting. N-R forms
    are attached.",nt"license_title": "License Not Specified",nt"extras":
